  // Listneners for manipulation of SVGs
  svg.addEventListener('mousedown', mousedown);
  svg.addEventListener('mousemove', mousemove);
  svg.addEventListener('mouseup', mouseup);
  svg.addEventListener('mouseleave', mouseleave);
  svg.addEventListener('touchstart', touchstart);
  svg.addEventListener('touchmove', touchmove);
  svg.addEventListener('touchend', touchend);
  svg.addEventListener('pointerup', pointerup);
  svg.addEventListener('touchleave', touchleave);
  svg.addEventListener('touchcancel', touchcancel);
  svg.addEventListener('wheel',mousewheel);

  var DEBUG=1;

  function mousedown(evt)   { if(DEBUG) console.log("mousedown"); press(evt) } // defererenced for logging
  function mousemove(evt)   { if(DEBUG) console.log("mousemove"); drag(evt) }
  function mouseup(evt)     { if(DEBUG) console.log("mouseup"); release(evt) }
  function mouseleave(evt)  { if(DEBUG) console.log("mouseleave"); release(evt) }
  function touchstart(evt)  { if(DEBUG) console.log("touchstart"); press(evt) }
  function touchmove(evt)   { if(DEBUG) console.log("touchmove"); drag(evt) }
  function touchend(evt)    { if(DEBUG) console.log("touchend"); release(evt) }
  function pointerup(evt)   { if(DEBUG) console.log("pointerup"); release(evt) }
  function touchleave(evt)  { if(DEBUG) console.log("touchleave"); release(evt) }
  function touchcancel(evt) { if(DEBUG) console.log("touchcancel"); release(evt) }
  function mousewheel(evt)  { if(DEBUG) console.log("wheel"); zoom(evt) }
  
  var selectedElement;
  var centre = {x:0,y:0};
  var selectedAt = {x:0,y:0};
  var lastAngle;
  var startAngle;
  var startPos={x:0,y:0};
  var draggedTo;
  var viewBoxAtSelect={x:0,y:0,height:0,width:0};
  var viewBox=document.getElementById("chart").viewBox.baseVal;
  viewBoxAtSelect.x=viewBox.x;
  viewBoxAtSelect.y=viewBox.y;
  viewBoxAtSelect.width=viewBox.width;
  viewBoxAtSelect.height=viewBox.height;

  var chart=document.getElementById("chart");
  let scaleFactor = 1.1;

  function getCentre(el) {
    bbox=el.getBBox();
    let x=bbox.x + (bbox.width/2); let y=bbox.y + (bbox.height/2);
    let theta=0;
    let transforms = el.transform.baseVal;
    let tmpg = document.createElementNS("http://www.w3.org/2000/svg", "g");
    if ( transforms.length !== 0) {
      //Duplicate the transforms for this element then collapse it into one matrix transform (by effectively multiplying all affine matrices together NB consolidate resets current object's stack therefore we make the copy!
      let matrix=svg.createSVGTransform();
      for (let i=0; i<transforms.length; i++ ) { tmpg.transform.baseVal.appendItem(svg.createSVGTransformFromMatrix(transforms.getItem(i).matrix)); } // Copy Transforms
      matrix = tmpg.transform.baseVal.consolidate().matrix; // Consolidate 
      return {x:((x*matrix.a)+(y*matrix.c)+matrix.e),y:((x*matrix.b)+(y*matrix.d)+matrix.f),theta:Math.atan2(matrix.b,matrix.a)*180/Math.PI};
    }
    return {x:x,y:y,theta:theta}
  }

  function mod(n,m) {  // remainder function "%" != "mod()" function, because negative remainders.
    if ( n<0 ) { return (n%m)+m; }
    else { return n%m; }
  }

  function getMousePosition(evt) {
    var SVGTransform = svg.getScreenCTM();
    let x,y,cx=0,cy=0,d=0,a=0,t=0;
    if (evt.touches) {
      cx=x=(evt.touches[0].clientX - SVGTransform.e) / SVGTransform.a;
      cy=y=(evt.touches[0].clientY - SVGTransform.f) / SVGTransform.d;
      if (evt.touches.length>1) {
        t=evt.touches.length;
        cx=((evt.touches[0].clientX + evt.touches[1].clientX)/2 - SVGTransform.e) / SVGTransform.a;
        cy=((evt.touches[0].clientY + evt.touches[1].clientY)/2 - SVGTransform.f) / SVGTransform.d;
        d=Math.sqrt((evt.touches[0].clientX-evt.touches[1].clientX)**2+(evt.touches[0].clientY-evt.touches[1].clientY)**2);
        t=evt.rotation;
      }
    } else {
      cx=x=(evt.clientX - SVGTransform.e) / SVGTransform.a;
      cy=y=(evt.clientY - SVGTransform.f) / SVGTransform.d;
    }
    return {x:x,y:y,cx:cx,cy:cy,d:d,a:a,t:t};
  }

  function insertOrUseRotation(el) {
    let transforms = el.transform.baseVal;
    if (transforms.length === 0 || transforms.getItem(0).type !== SVGTransform.SVG_TRANSFORM_ROTATE) {
      let rotate = svg.createSVGTransform();
      rotate.setRotate(0, centre.x, centre.y);
      el.transform.baseVal.insertItemBefore(rotate, 0); // place this rotate at the beginning
    }
  }

  function insertOrUseTranslation(el) {
    let transforms = el.transform.baseVal;
    if (transforms.length === 1 || transforms.getItem(1).type !== SVGTransform.SVG_TRANSFORM_TRANSLATE) {
      let translate = svg.createSVGTransform();
      translate.setTranslate(0, 0);
      selectedElement.transform.baseVal.insertItemBefore(translate, 1); // place this translate at the beginning + 1
    }
  }

  function press(evt) {
    evt.preventDefault(); 
    if (interaction=='draw') {
      ann=document.getElementById('annotation');
      if (evt.target.id.match(/^(?:touch|down)[0-9]+/)) {
        selectedElement=evt.target;
      }
      else {
        selectedAt = getMousePosition(evt);
        dumbbell=document.createElementNS("http://www.w3.org/2000/svg", 'g');
        dumbbell.setAttribute('id',"dumbbell"+interactionid++);
        circle=document.createElementNS("http://www.w3.org/2000/svg", 'circle');
        circle.setAttribute('cx',selectedAt.x);
        circle.setAttribute('cy',selectedAt.y);
        circle.setAttribute('r',5);
        circle.setAttribute('style','fill-opacity:0.1;stroke:#ff0000;stroke-width:1;');
        circle.setAttribute('id',"touch"+interactionid++);
        dumbbell.appendChild(circle);
        ann.appendChild(dumbbell);
        selectedElement=dumbbell;
      }
      return
    }
    if (evt.target.id=="protractorSelect") {
      selectedElement = document.getElementById("protractor"); 
      selectedAt = getMousePosition(evt);
      centre = getCentre(selectedElement.parentNode);
      insertOrUseRotation(selectedElement);
      lastAngle=mod(((Math.atan2(selectedAt.x-centre.x,selectedAt.y-centre.y)*180/Math.PI)),360); //get angle of leaver handle
    }
    else if (evt.target.id=="plotterFill") {
      selectedElement = document.getElementById("plotter");
      selectedAt = getMousePosition(evt);
      centre = getCentre(selectedElement);
      insertOrUseRotation(selectedElement);
      insertOrUseTranslation(selectedElement);
      startAngle=mod(0-((Math.atan2(centre.x-selectedAt.x,centre.y-selectedAt.y)*180/Math.PI)),360); //get angle of leaver handle
      startPos={x:(centre.x+(centre.x-selectedAt.x)/2),y:(centre.y+(centre.y-selectedAt.y)/2)}
    }
    else { 
      selectedElement = document.getElementById("chart"); // chart is the id of the svg.
      selectedAt = getMousePosition(evt);
      viewBox=selectedElement.viewBox.baseVal;
      viewBoxAtSelect.x=viewBox.x;
      viewBoxAtSelect.y=viewBox.y;
      viewBoxAtSelect.width=viewBox.width;
      viewBoxAtSelect.height=viewBox.height;
    }
  }

  function drag(evt) {
    evt.preventDefault(); // turn off default actions ???Needed???
    if (selectedElement) { // can only drag if an element is selected
      if (interaction=='draw') {
        if (selectedElement.id.match(/^touch[0-9]+/)) {
          let x=getMousePosition(evt).x;
          let y=getMousePosition(evt).y;
          selectedElement.setAttribute('cx',x);
          selectedElement.setAttribute('cy',y);
          selectedElement.parentNode.children[1].setAttribute('x1',x);
          selectedElement.parentNode.children[1].setAttribute('y1',y);
          return;
        } else if (selectedElement.id.match(/^down[0-9]+/)) {
          let x=getMousePosition(evt).x;
          let y=getMousePosition(evt).y;
          selectedElement.setAttribute('cx',x);
          selectedElement.setAttribute('cy',y);
          selectedElement.parentNode.children[1].setAttribute('x2',x);
          selectedElement.parentNode.children[1].setAttribute('y2',y);
          return;
        } else if (selectedElement.id.match(/^dumbbell[0-9]+/)) {
          if ( selectedElement.childElementCount == 1 ) {
            line=document.createElementNS("http://www.w3.org/2000/svg", 'line');
            console.log("sel "+selectedAt.x+" to "+getMousePosition(evt).x);
            line.setAttribute('x1',selectedAt.x); // is centre of blob now
            line.setAttribute('y1',selectedAt.y);
            line.setAttribute('x2',getMousePosition(evt).x);
            line.setAttribute('y2',getMousePosition(evt).y);
            line.setAttribute('style','stroke:#ff0000;stroke-width:0.5;');
            selectedElement.appendChild(line);
          } else {
            line.setAttribute('x2',getMousePosition(evt).x);
            line.setAttribute('y2',getMousePosition(evt).y);
          }
        }
        return;
      }
      if (selectedElement.id=="protractor") {
        draggedTo  = getMousePosition(evt); // where is the mouse now?
        let thisAngle  = mod(((Math.atan2(draggedTo.x-centre.x,draggedTo.y-centre.y)*180/Math.PI)),360); // new lever position
        rotateTo = selectedElement.transform.baseVal.getItem(0).angle-(thisAngle - lastAngle);
        lastAngle = thisAngle;
        let pcentre=getCentre(selectedElement);
        selectedElement.transform.baseVal.getItem(0).setRotate(rotateTo,pcentre.x,pcentre.y);
        document.getElementById("markerangle").innerHTML=""+mod(360-Math.round(pcentre.theta),360)+"°";
      }
      else if (selectedElement.id=="plotter") {
        draggedTo  = getMousePosition(evt); // where is the mouse now?
        selectedElement.transform.baseVal.getItem(1).setTranslate(draggedTo.x-selectedAt.x,draggedTo.y-selectedAt.y);
        if (draggedTo.t >1) {
          selectedElement.transform.baseVal.getItem(0).setRotate(startAngle+draggedTo.a,draggedTo.x,draggedTo.y);
        } else {
          let thisAngle=mod(0-Math.atan2(startPos.x-draggedTo.x,startPos.y-draggedTo.y)*180/Math.PI,360);
          selectedElement.transform.baseVal.getItem(0).setRotate(thisAngle-startAngle,draggedTo.x,draggedTo.y);
        }
      } else if (selectedElement.id=="chart") {
        draggedTo  = getMousePosition(evt);
        const dx = selectedAt.cx - draggedTo.cx;
        const dy = selectedAt.cy - draggedTo.cy;
        selectedElement.viewBox.baseVal.x+=dx;
        selectedElement.viewBox.baseVal.y+=dy;
        if ( draggedTo.d != selectedAt.d ) { 
          console.log("Need to zoom here: d="+draggedTo.d+" orig="+selectedAt.d);
          let delta = draggedTo.d - selectedAt.d;
          let zoomFactor = selectedAt.d/draggedTo.d;
          viewBox.width = viewBoxAtSelect.width*zoomFactor;
          viewBox.height = viewBoxAtSelect.height*zoomFactor;
          viewBox.x = draggedTo.cx - (draggedTo.cx - viewBoxAtSelect.x) * zoomFactor;
          viewBox.y = draggedTo.cy - (draggedTo.cy - viewBoxAtSelect.y) * zoomFactor;
        }
      }
    }
  }
  function zoom(evt) {
    evt.preventDefault();
    const { offsetX, offsetY, deltaY } = evt;
    const svgRect = svg.getBoundingClientRect();

    const mouseX = offsetX / svgRect.width * viewBox.width + viewBox.x;
    const mouseY = offsetY / svgRect.height * viewBox.height + viewBox.y;
    const zoomIn = deltaY < 0;

    const zoomFactor = zoomIn ? 1 / scaleFactor : scaleFactor;

    viewBox.width *= zoomFactor;
    viewBox.height *= zoomFactor;
    viewBox.x = mouseX - (mouseX - viewBox.x) * zoomFactor;
    viewBox.y = mouseY - (mouseY - viewBox.y) * zoomFactor;

  }
  function release(evt) {
    if (selectedElement) {
      if (interaction=='draw') {
        if (selectedElement.id.match(/^dumbbell[0-9]+/)) {
          if ( selectedElement.childElementCount == 2 ) {
            circle=document.createElementNS("http://www.w3.org/2000/svg", 'circle');
            circle.setAttribute('cx',getMousePosition(evt).x);
            circle.setAttribute('cy',getMousePosition(evt).y);
            circle.setAttribute('r',5);
            circle.setAttribute('style','fill-opacity:0.1;stroke:#00ff00;stroke-width:1;');
            circle.setAttribute('id',"down"+interactionid++);
            selectedElement.appendChild(circle);
          }
        }
      }
      selectedElement.transform.baseVal.consolidate();
      console.log('Released');
      selectedElement = false; // forget selection
    }
    if (evt.target.id=="SV") {
      draw=false;
    }
    if (evt.target.id=="draw") draw=false;
  }
}

